import React from 'react';
import ReactDOM from 'react-dom';

export default function PriceAndInfoSideDiv(props) {
    render() ; {
        return (
            <div class="divPrice z-depth-5">
                Price: <br />
                0.1 ETH/FESB <br />
                10 FESB/ETH <br /><br />

                Pool info:<br />
                10 FESB <br />
                1 ETH
            </div>
        );
    }
}
